package com.github.jamesdbloom.target.event;

import com.github.jamesdbloom.target.TargetIdentifier;
import com.github.jamesdbloom.target.event.serializer.EventSerializer;
import lombok.RequiredArgsConstructor;
import org.springframework.stereotype.Service;

import java.time.LocalDateTime;

@Service
@RequiredArgsConstructor
public class TargetEventPublicationService {

	private final TargetEventPublicationRepository publicationRepository;

	private final EventSerializer eventSerializer;

	public TargetEventPublication create(TargetEventPublication publication) {

		var identifier = publication.getIdentifier();
		var publicationDate = publication.getPublicationDate();
		var listenerId = publication.getTargetIdentifier().getValue();
		var event = publication.getEvent();
		var eventType = event.getClass().getName();

		var eventSerialized = eventSerializer.serialize(event).toString();
		var eventHash = DigestUtils.md5DigestAsHex(eventSerialized.getBytes());

		var publication = new TargetEventPublication(
			identifier,
			publicationDate,
			new TargetIdentifier(listenerId),
			event,
			eventType,
			eventHash
		);

		return publicationRepository.save(publication);
	}

}
